from random import randrangebukv = 'qwertyuipasdfghjkzxcvbnm23456789QWERTYUPASDFGHJKLZXCVBNM'def generate_password(m):    pas = ''    uses = []    for i in range(m):        while True:            p = bukv[randrange(0, len(bukv))]            if p not in uses:                pas += p                uses.append(p)                break    return pasdef main(n, m):    s = []    for i in range(n):        a = generate_password(m)        if a in s:            while a in s:                a = generate_password(m)            s.append(a)        else:            s.append(a)    return s